The Babel fish (according to &quot;The Hitch Hiker's Guide to the Galaxy&quot;) is &quot;small, yellow leech-like and probably the oddest thing in the universe... the practical upshot of which is that if you stick one in your ear, you can instantly understand anything said to you in any form of language.&quot;  
The white/green/orange Babel fish, as pictured here, is an unusual sub-species.  Instead of providing an unadultered translation of anything said to you, skews the brain wave matrix and makes everything sound sarcastic.  Use of this sub-species has directly resulted in 42 major armed conflicts and one marriage.  
Printed in white, jasmine green and orange PLA from 3DKarma (<a rel="nofollow" href="http://www.3dkarma.com" >http://www.3dkarma.com</a>).
